import "./App.css";
import ContentContainer from "./components/ContentContainer";
import CardComponent from "./components/CardComponent";

function App() {
  const img_file = "cat";
  return (
    <div className="App">
      <ContentContainer img_file={img_file}>
        <CardComponent />
        <CardComponent />
      </ContentContainer>
    </div>
  );
}

export default App;
